import React from 'react';
import ReactDOM from 'react-dom';
import "./index.css"
import Sdata from "./Sdata"


function ncard(val){
  console.log(val)
  return(

    <Card

    sname={val.sname}
    imgsrc={val.imgsrc}
    title={val.title}
    links={val.links}
    />

  );
}

ReactDOM.render(
  <>
  <h1 className = 'heading'> Integrated-Home Unified Stability Test System </h1>

  {Sdata.map(ncard)}

  </>

  ,document.getElementById('root')
);
